// --- running context

let above = document.getElementById('video1');
let front = document.getElementById('video2');
let below = document.getElementById('video3');
let group = [ above, front, below ];
let pos   = { slide: false }; // other attributes set within the code
let which = 0;  // initial front source index

// --- security function

function encrypt(text, passphrase) { return CryptoJS.AES.encrypt(text, passphrase).toString() }
function decrypt(text, passphrase) { return CryptoJS.AES.decrypt(text, passphrase).toString(CryptoJS.enc.Utf8) }

// --- intialisation

function init() {
    group.forEach(i => {
        i.addEventListener('touchstart', onTouchStart, { passive: false });
        i.addEventListener('touchmove' , onTouchMove , { passive: false });
        i.addEventListener('touchend'  , onTouchEnd  , { passive: false });
        i.addEventListener('mousedown' , onTouchStart);
        i.addEventListener('loadedmetadata', () => { i.currentTime = i.duration * START / 100 });
        i.addEventListener('error',          () => { console.error(`Video '${ i.currentSrc }' failed to load`) });
    });

    document.addEventListener('mousedown', onTouchStart);
    document.addEventListener('mousemove', onTouchMove );
    document.addEventListener('mouseup'  , onTouchEnd  );

    sources = sources.sort(() => Math.random() - 0.5);

    load(front, which);  // load before reset
    reset(which);
}

// --- loads a video element with a source

function load(video, idx) {
    video.querySelector('source').src = decrypt(sources[idx], PARAM.get('k') || '');
    video.setAttribute('data-idx', idx);
    video.load();
}

// --- resets video element set

function reset(idx) {
    front.play();
    front.style.zIndex = LAYER.FRONT;

    let prev = idx === 0 ? sources.length - 1 : idx - 1;
    load(above, prev);

    let next = idx === sources.length - 1 ? 0 : idx + 1;
    load(below, next);
}

// --- gets the current transform in the Y axis

function shift(video) {
    let matrix = window.getComputedStyle(video).transform.split(',');
    return matrix.length > 5 ? parseFloat(matrix[5]) : 0;
}

// --- the slide translation

function slide(amount, pixels = false) {
    return `translate(-50%,  ${ amount }${ pixels ? 'px' : '%' })`;
}

// --- touch has begun

const onTouchStart = (event) => {
    pos.began = event.touches ? event.touches[0].clientY : event.clientY;
    pos.shift = shift(front);
    pos.touch = pos.began;
    pos.slide = true;

    group.forEach(i => i.classList.add('sliding'));

    event.preventDefault();
};

// --- touch is ongoing

const onTouchMove = (event) => {
    if (pos.slide) {
        pos.touch = event.touches ? event.touches[0].clientY : event.clientY;
        let move = pos.shift + pos.touch - pos.began;

        above.style.transform = slide(move - window.innerHeight, true);
        front.style.transform = slide(move                     , true);
        below.style.transform = slide(move + window.innerHeight, true);

        event.preventDefault();
    }
};

// --- touch has ended

const onTouchEnd = (event) => {
    const DELTA = 100; // ms - delta to wait after transition to reset
    const MID   = -50; // %  - the vertical midpoint

    let swapping = Math.abs(pos.touch - pos.began) > (window.innerHeight * MOVED / 100); // moved enough to trigger a swap
    let downward = pos.touch > pos.began;

    group.forEach(i => {
        i.style.transition = `transform ${ SPEED / 1000 }s ease-out`;
        i.style.zIndex     = LAYER.BACK;
    });

    pos.slide = false;

    if (swapping) {
        if (downward) {
            above.style.zIndex = LAYER.FRONT;
            above.style.transform = slide(MID);
            front.style.transform = slide(MID + 100);
            below.style.transform = slide(MID + 200);
        }
        else {
            below.style.zIndex = LAYER.FRONT;
            above.style.transform = slide(MID - 200);
            front.style.transform = slide(MID - 100);
            below.style.transform = slide(MID);
        }
    }
    else {
        front.style.zIndex = LAYER.FRONT;
        above.style.transform = slide(MID - 100);
        front.style.transform = slide(MID);
        below.style.transform = slide(MID + 100);
    }

    // --- after transition complete we reset everything

    setTimeout(() => {
        group.forEach(i => {
            i.style.transition = 'none';
            i.style.transform  = slide(MID);
            i.classList.remove('sliding');
        });

        if (swapping) {
            let other = front;

            if (downward) {
                front = above;
                above = other;
            }
            else {
                front = below;
                below = other;
            }

            reset(parseInt(front.getAttribute('data-idx')));
        }
    }, SPEED + DELTA);

    event.preventDefault();
};

// --- entry point

init();
